module.exports = "<div class=\"card\">\n    <div class=\"card-header\"><h2>Quick Start: New Git Repository with NPM</h2></div>\n    <div class=\"card-body\">\n        <h3>Overview</h3>\n        <ol>\n            <li>Create remote repository and clone locally</li>\n            <li>Initialize NPM for repository (generate a <samp>package.json</samp> file)</li>\n        </ol>\n        <div class=\"card\">\n            <div class=\"card-header\"><h3>1. Initialize Repository</h3></div>\n            <div class=\"card-body\">\n                <div class=\"card\">\n                    <div class=\"card-header\"><h4>a. Determine initial repository settings</h4></div>\n                    <div class=\"card-body\">\n                        <dl>\n                            <dd>Repository Name</dd>\n                            <dt>Name of repository you'll be creating.</dt>\n                            <dt>Description</dt>\n                            <dd>Optional (but recommended) - Short description of the new repository.</dd>\n                            <dt>Add a license</dt>\n                            <dd>Optional (but recommended) - Typically, you would\n                                <a href=\"https://choosealicense.com/\" target=\"_blank\">choose an open source license</a> to apply the contents of the repository.\n                                <blockquote class=\"border border-info p-3 text-secondary bg-light ml-3\">\n                                    Generally, in Git repositories, a\n                                    <a href=\"https://help.github.com/articles/licensing-a-repository/#determining-the-location-of-your-license\" target=\"_blank\">LICENSE</a>\n                                    file will contain the actual terms of the license for the contents of the repository.\n                                    The <a href=\"https://docs.npmjs.com/files/package.json\" target=\"_blank\">package.json</a> file that will be generated will also\n                                    contain an <a href=\"https://spdx.org/licenses/\" target=\"_blank\">identifier string</a> that indicates the license to be applied to\n                                    the contents.\n                                    <p>The default license identifier for <a href=\"https://docs.npmjs.com/files/package.json\" target=\"_blank\">NPM packages</a> is\n                                        <samp>ISC</samp>, which represents the <q>Open Source Initiative</q> license. However (as of the time this document was created)\n                                        GitHub does not have an option for automatically adding a\n                                        <a href=\"https://help.github.com/articles/licensing-a-repository/#determining-the-location-of-your-license\" target=\"_blank\">LICENSE</a>\n                                        file for an <q>Open Source Initiative</q> license.</p>\n                                    <p>One option would be to select <samp>GNU General Public License v3.0</samp> when you create the remote repository, and then\n                                        entering <kbd>GPL-3.0</kbd> when you initialize the repository for NPM.</p>\n                                    <p>If you wish to use <samp>ISC</samp> as the license for the\n                                        <a href=\"https://docs.npmjs.com/files/package.json\" target=\"_blank\">package.json</a> file,\n                                        see <a href=\"https://opensource.org/licenses/ISC\" target=\"_blank\">https://opensource.org/licenses/ISC</a>\n                                        for a template wording to use in a corresponding\n                                        <a href=\"https://help.github.com/articles/licensing-a-repository/#determining-the-location-of-your-license\" target=\"_blank\">LICENSE</a>\n                                        file. Verbiage for additional open source license terms can be viewed at\n                                        <a href=\"https://opensource.org/licenses\" target=\"_blank\">https://opensource.org/licenses</a></p>\n                                </blockquote>\n                            </dd>\n                        </dl>\n                    </div>\n                </div>\n                <div class=\"card\">\n                    <div class=\"card-header\"><h4>b. Create new remote GitHub repository</h4></div>\n                    <div class=\"card-body\">\n                        Use the pre-determined repository settings from the previous step, along with the other following options:\n                        <dl>\n                            <dt>Initialize this repository with a README</dt>\n                            <dd>Optional (but recommended) - Adds README.md to the repository.</dd>\n                            <dt>Add .gitignore</dt>\n                            <dd>Select <kbd>Node</kbd>.</dd>\n                        </dl>\n                    </div>\n                </div>\n                <div class=\"card\">\n                    <div class=\"card-header\"><h4>c. Make local clone of remote repository</h4></div>\n                    <div class=\"card-body\">\n                        From the terminal window or a git bash/cmd prompt, change to the subdirectory which is going to be the parent folder of the local repository,\n                        and clone the remote repository.\n                        <pre class=\"console-pane pre-scrollable\"><code>cd <kbd>parentDirectory</kbd>\ngit clone --recurse-submodules <kbd>repository_url</kbd></code></pre>\n                        A subdirectory will be created which is the same name as the remote repository.\n                    </div>\n                </div>\n            </div>\n        </div>\n        <div class=\"card\">\n            <div class=\"card-header\"><h3>2. Initialize NPM</h3></div>\n            <div class=\"card-body\">\n                Open the terminal windows and change to the subdirectory of the local repository, then execute the NPM initialization command.\n                <pre class=\"console-pane pre-scrollable\"><code>cd <kbd>path_to_repository</kbd>\nnpm init</code></pre>\n                Answer the prompts as follows:\n                <dl>\n                    <dt>package name</dt>\n                    <dd>Typically, you can just hit enter and accept the defaults, which will probably the same as the repository name in all lower-case letters.</dd>\n                    <dt>version</dt>\n                    <dd>You can accept the default or enter a different version number, depending upon your preference.</dd>\n                    <dt>description</dt>\n                    <dd>You can use the same description you used when you created the remote repository.</dd>\n                    <dt>entry point</dt>\n                    <dd>It is usually okay to accept the default value, and won't break anything. This may change, depending upon what is going to be in the NPM package.</dd>\n                    <dt>test command</dt>\n                    <dd>This can be left blank, unless you already know what to enter here.</dd>\n                    <dt>git repository</dt>\n                    <dd>NPM should be able to guess the default value correctly (from the git settings). Otherwise, enter the URL you used when you cloned the remote repository.</dd>\n                    <dt>keywords</dt>\n                    <dd>If is okay to leave this initially blank.</dd>\n                    <dt>author</dt>\n                    <dd>Name of the author (presumably, yourself).</dd>\n                    <dt>license</dt>\n                    <dd>This is an <a href=\"https://spdx.org/licenses/\" target=\"_blank\">abbreviated string which represents the license</a> associated with the NPM package. If you added a <a href=\"https://help.github.com/articles/licensing-a-repository/#determining-the-location-of-your-license\" target=\"_blank\">LICENSE</a>\n                        file when you created the remote repository, then this should correspond with that license.\n                    </dd>\n                </dl>\n            </div>\n        </div>\n    </div>\n</div>\n<!--\n    npm WARN gulp-angular@0.1.2 requires a peer of gulp@~3.6.2 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-util@~2.2.14 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-clean@~0.2.4 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-inject@~0.4.1 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-tap@~0.1.1 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of deep-extend@~0.2.8 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of minimist@0.0.8 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of event-stream@~3.1.2 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-concat@~2.2.0 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-ngmin@~0.2.0 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-uglify@~0.2.1 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-insert@~0.3.0 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-rename@~1.2.0 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-ng-html2js@~0.1.6 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-minify-html@~0.1.3 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-minify-css@~0.3.1 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-size@~0.3.0 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-svgmin@~0.4.5 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of express@~4.1.1 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-filter@~0.4.1 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of karma@~0.12.16 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-karma@0.0.4 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of glob@~3.2.9 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of karma-jasmine@~0.1.5 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of karma-phantomjs-launcher@~0.1.4 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of gulp-autoprefixer@~0.0.7 but none is installed. You must install peer dependencies yourself.\nnpm WARN gulp-angular@0.1.2 requires a peer of karma-xml-reporter@~0.1.4 but none is installed. You must install peer dependencies yourself.\n-->\n<div class=\"card\">\n    <div class=\"card-header\"><h2>Managing packages</h2></div>\n    <div class=\"card-body\">\n        Show packages installed (without listing dependencies):\n        <pre class=\"console-pane pre-scrollable\"><code>npm list --depth 0</code></pre>\n        Update local packages:\n        <pre class=\"console-pane pre-scrollable\"><code>npm update</code></pre>\n        Update global packages:\n        <pre class=\"console-pane pre-scrollable\"><code>npm update -g</code></pre>\n        Install / Refresh packages in package.json file:\n        <pre class=\"console-pane pre-scrollable\"><code>npm install</code></pre>\n        Upgrade to latest version of NPM itself:\n        <pre class=\"console-pane pre-scrollable\"><code>npm install npm@latest -g</code></pre>\n        Remove local package:\n        <pre class=\"console-pane pre-scrollable\"><code>npm uninstall <kbd>package_name</kbd></code></pre>\n        Remove global package:\n        <pre class=\"console-pane pre-scrollable\"><code>npm uninstall <kbd>package_name</kbd> -g</code></pre>\n    </div>\n</div>\n<div class=\"card\">\n    <div class=\"card-header\"><h3>Common Global NPM Modules</h3></div>\n    <div class=\"card-body\">\n        I have found that for some modules, it is best to install them globally if you intend to use them. When you actually use them in your project, it's good to install them locally as well. Following are some of the modules I found I needed to install globally:\n        <ul>\n            <li><strong>gulp:</strong> This can be useful for defining more complicated tasks.</li>\n            <li><strong>uglify-js:</strong> This is used for compiling many JavaScript files into a single distributable.</li>\n            <li><strong>mocha:</strong> This is a unit testing framework.</li>\n            <li><strong>eslint:</strong> Error checking for JavaScript</li>\n            <li><strong>@types:</strong> This contains many modules which provide typescript definitions</li>\n            <ul>\n                <li>@types/core-js</li>\n                <li>@types/node</li>\n                <li>@types/jquery</li>\n                <li>@types/mocha</li>\n                <li>@types/angular</li>\n                <li>@types/uglify-js</li>\n                <li>@types/bootstrap</li>\n            </ul>\n            <li><strong>generator-code:</strong> Creates a boilerplace file and folder structure to create your own Visual Code extension or customization package.</li>\n            <li><strong>jshint:</strong> Adds JavaScript intellisense.</li>\n            <li><strong>tslint:</strong> Error checking for TypeScript</li>\n            <li><strong>typescript:</strong> Adds TypeScript intellisense.</li>\n            <li><strong>vsce:</strong> Assists with publishing your own Visual Studio code extensions.</li>\n            <li><strong>yo:</strong> Scaffolding system which services as the base framework for many other modules  which create boilerplate code for many project types.  These other modules should also be installed globally, as well. Following are some generator modules which use yo:</li>\n            <ul>\n                <li><strong>angular:</strong> AngularJS project</li>\n                <li><strong>gulp-angular:</strong> AngularJS project with Gulp</li>\n                <li><strong>webapp:</strong> Front-end web app</li>\n                <li><strong>javascript:</strong> JavaScript library</li>\n                <li><strong>node:</strong> node.js module</li>\n                <li><strong>bootstrap:</strong> Add bootstrap to a project</li>\n                <li><strong>node-typescript:</strong> Node.Js module  using TypeScript</li>\n            </ul>\n        </ul>\n    </div>\n</div>\n"

